import React from 'react';

function WordList({ words }) {
  return (
    <div>
      {words.map((word, index) => (
        <div key={index} className='japaneseWord'>
          <p>Kana: {word.kana}</p>
          <p>Meaning: {word.meaning}</p>
        </div>
      ))}
    </div>
  );
}

export default WordList;
